import React from 'react';
import './demo.css';

function Demo() {
    return (
        <div>
            <section className='demo'>
                <div className='container'>
                    <div className='row'>
                        <div className='col-md-12'>
                            <h2>If you still feel unsure, try a risk free 15-day demo.</h2>
                            <a href='#' className='demo-btn'>Book Demo</a>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    )
}

export default Demo
